Let $r$ be the radius of the smaller semicircle. Then the radius of the larger semicircle is $2r$.

The area of the larger semicircle is $\frac{1}{2}\pi(2r)^2 = 2\pi r^2$.

The area of the smaller semicircle is $\frac{1}{2}\pi r^2$.

The area of the shaded region is the difference between the area of the larger semicircle and the area of the smaller semicircle, which is $2\pi r^2 - \frac{1}{2}\pi r^2 = \frac{3}{2}\pi r^2$.

The area of the shaded region is also equal to the area of the rectangle formed by the radii $AQ$ and $BQ$, which is $2r \cdot 2r = 4r^2$.

Setting these two expressions for the area of the shaded region equal to each other, we have $\frac{3}{2}\pi r^2 = 4r^2$.

Dividing both sides by $r^2$, we get $\frac{3}{2}\pi = 4$.

Solving for $r$, we have $r = \frac{4}{3\pi}$.

Therefore, the radius of the smaller semicircle is $\boxed{\frac{4}{3\pi}}$.The answer is: \frac{4}{3\pi}

