Multiplying this equation by $\alpha_1\alpha_2\alpha_3\alpha_4$, we get
\begin{align*}
\alpha_1^2\alpha_2\alpha_3 + \alpha_1\alpha_2^2\alpha_3 + \alpha_1\alpha_2\alpha_3^2 + \alpha_1\alpha_2\alpha_3\alpha_4 &= 0.
\end{align*}
Similarly, we can multiply the equation $\alpha_1 + \alpha_2 + \alpha_3 + \alpha_4 = 0$ by $\alpha_1\alpha_2\alpha_3$ and $\alpha_1\alpha_2\alpha_4$ to get
\begin{align*}
\alpha_1^2\alpha_2\alpha_3 + \alpha_1\alpha_2^2\alpha_3 + \alpha_1\alpha_2\alpha_3^2 + \alpha_1\alpha_2\alpha_3\alpha_4 &= 0, \\
\alpha_1^2\alpha_2\alpha_4 + \alpha_1\alpha_2^2\alpha_4 + \alpha_1\alpha_2\alpha_3\alpha_4 + \alpha_1\alpha_2\alpha_3^2 &= 0.
\end{align*}
Subtracting these equations, we get
\begin{align*}
\alpha_1\alpha_2\alpha_3\alpha_4 &= 0.
\end{align*}
